import React from 'react';
import '../App.css';



class Navbar extends React.Component {
    constructor() {
        super ()
        this.state = {
            cityQuery : ""
        }

        this.handleSubmit = this.handleSubmit.bind(this)
    }


    handleSubmit(event) {
            event.preventDefault();
            const cityQuery = this.state.cityQuery
            const handleFormSubmit= this.props.handleFormSubmit
            handleFormSubmit(cityQuery)
    }

    render() {

        return (
            <div className="navbar">

                <form onSubmit = {this.handleSubmit} className="navbar">

                    <label id = "inputLabel">  
                    <input 
                        className="inputField"
                        type ="text" 
                        name = "city"  

                        placeholder = "Name of city"/>
                    </label>

                    <button id="button">Get Weather</button>

                </form>

             </div>
        )
        }
}

export default Navbar;
